import React, { useState } from 'react';

function MyComponent() {
  const [isHovered, setIsHovered] = useState(false);

  const handleMouseEnter = () => {
    setIsHovered(true);
  };

  const handleMouseLeave = () => {
    setIsHovered(false);
  };

  return (
    <div>
    <h1
        className={`text-black transition duration-300 p-4 ${
          isHovered ? 'filter blur-md' : 'filter blur-sm'
        }`}
      >
        Lorem ipsum dolor sit amet consectetur adipisicing elit
      </h1>
      <p
        className={`text-black transition duration-300 p-4 ${
          isHovered ? 'filter blur-md bg-slate-300' : 'filter blur-sm'
        }`}
      >
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quod suscipit dolorem soluta, repudiandae nostrum itaque quisquam amet, ipsa quas dolor atque iure placeat. Explicabo, ratione? Consequatur doloremque architecto nihil iste!
      </p>
      <button
        className={`transition duration-300 p-2 mt-4 ${
          isHovered ? 'filter blur-md' : 'filter blur-sm'
        }`}
      >
        <a href="/contact" className="text-black">
          Contact Us
        </a>
      </button>
      <div
        className={`fixed top-0 left-0 w-screen h-screen ${
          isHovered ? 'blur-md' : 'blur-sm'
        }`}
        // style={{
